import { Container } from 'react-bootstrap';

function HeaderComponent({ content }) {
    return (
        <header id="header" className="pageHeader d-flex flex-column justify-content-center">
            <Container>
                {content.map(({ title, subtitle, cta, href }) => (
                    <React.Fragment key={title}>
                        <h1 className='text-light display-1 fw-bold'>{title}</h1>
                        <p className='text-light lead fw-bold mb-4'>{subtitle}</p>
                        <a className='w-max bg-light text-dark fw-bolder rounded-2 text-light py-2 px-3 text-decoration-none' href={href}>{cta}</a>
                    </React.Fragment>
                ))}
            </Container>
        </header>
    );
}

export default HeaderComponent;
